import React from 'react';
import './Tag.scss';
import tags from '../../tags';

export const TAG_TYPES = {
    SMALL : 'tag-samll'
}

const Tag = props => (
    <div
        className='tag'
        style={{ backgroundColor: props.color }}
    >
        {props.name}
    </div>
)

export default Tag
